import React, { useState } from 'react';
import './header.scss';
import Button from 'react-bootstrap/Button';
import SignIn from './SigIn-block/SignIn';
import { Container,Row,Col } from 'react-bootstrap';

export default function Header() {
    const [headerItems, setheaderItems]=useState(['CSRX','CAUSES','IMPACT','JOIN US','ABOUT US']);
    return (
        <Row>
            <Col lg="12" md="12" sm="12">
                <Col lg="7">
                {
                    headerItems.map((item)=>{
                        return(<span className="headerItem">{item}</span>)
                    })
                }
                </Col>
                <Col lg="4">
                    <Button variant="outline-secondary" className="donate-btn">Donate</Button>
                    <SignIn />
                </Col>
            </Col>
        </Row>
    );
}
